    "Wrong password": "Fel l\u00f6senord",
    "You are not in any groups. Groups allow multiple people to collaborate on libraries. Groups you join will be listed here.": "Du \u00e4r inte i n\u00e5gon grupp. Grupper till\u00e5ter flera personer att samarbeta med kataloger. Grupper som du g\u00e5r med i kommer listas h\u00e4r.",
    "You are not in any groups. Groups allow multiple people to collaborate on libraries. You can create a group by clicking the \"New Group\" button in the menu bar.": "Du \u00e4r inte i n\u00e5gon grupp. Grupper till\u00e5ter flera personer att samarbeta med kataloger. Du kan skapa en grupp genom att klicka p\u00e5 \"Ny Grupp\" knappen i menyn.",
    "You can also add a user as a guest, who will not be allowed to create libraries and groups.": "Du kan ocks\u00e5 l\u00e4gga till en anv\u00e4ndare som g\u00e4st, som inte kommer kunna skapa kataloger eller grupper.",
    "You can create files quickly": "Du kan skapa filer snabbt",
    "You can create libraries by clicking the \"New Library\" button above.": "Du kan skapa kataloger genom att klicka p\u00e5 \"Ny Katalog\" knappen ovan.",
    "You can use this field at login.": "Du kan anv\u00e4nda detta f\u00e4lt vid inloggning.",
    "You don't have any favorite items yet": "Du har inga favoritobjekt \u00e4nnu",
    "You don't have any share links": "Du har inga delningsl\u00e4nkgar",
    "You don't have any upload links": "Du har inga uppladdningsl\u00e4nkar",
    "You have an unsaved draft. Do you like to use it?": "Du har ett osparat utkast. Vill du l\u00e4gga till den?",
    "You have not accessed your files with any client (desktop or mobile) yet. Configure clients on your devices to access your data more comfortably.": "Du har inte \u00f6ppnat dina filer med n\u00e5gon klient (skrivbord eller mobil) \u00e4nnu. Konfigurera klienter p\u00e5 dina enheter f\u00f6r att komma \u00e5t din data enklare.",
    "You have not added any libraries, folders or files to your favorites yet. A favorite gives you quick access to your most frequently used objects. You can add a library, folder or file to your favorites by clicking the star to the left of its name.": "Du har inte lagt till n\u00e5gra kataloger, mappar eller filer till dina favoriter \u00e4nnu. En favorit ger dig snabbt \u00e5tkomst till dina mest frekvent anv\u00e4nda objekt. Du kan l\u00e4gga till en katalog, mapp eller fil till dina favoriter genom att klicka p\u00e5 stj\u00e4rnan till v\u00e4nster om dess namn.",
    "You have not created any libraries yet. A library is a container to organize your files and folders. A library can also be shared with others and synced to your connected devices. You can create a library by clicking the \"New Library\" button in the menu bar.": "Du har inte skapat n\u00e5gra kataloger \u00e4nnu. En katalog \u00e4r en container f\u00f6r att organisera dina filer och mappar. En katalog kan \u00e4ven delas med andra och synkroniseras med dina anslutna enheter. Du kan skapa en katalog genom att klicka p\u00e5 \"Ny Katalog\" knappen i menyn.",
    "You have not created any share links yet. A share link can be used to share files and folders with anyone. You can create a share link for a file or folder by clicking the share icon to the right of its name.": "Du har inte skapat n\u00e5gra delningsl\u00e4nkar \u00e4nnu. En delningsl\u00e4nk kan anv\u00e4ndas av anv\u00e4ndare till att dela filer och mappar med vem som helst. Du kan skapa en delningsl\u00e4nk f\u00f6r en fil eller mapp genom att klicka p\u00e5 delningsikonen till h\u00f6ger om dess namn.",
    "You have not created any upload links yet. An upload link allows anyone to upload files to a folder or library. You can create an upload link for a folder or library by clicking the share icon to the right of its name.": "Du har inte skapat en uppladdningsl\u00e4nk \u00e4nnu. En uppladdningsl\u00e4nk till\u00e5ter vem som helst att ladda upp filer till en mapp eller katalog. Du kan skapa en uppladdningsl\u00e4nk f\u00f6r en mapp eller katalog genom att klicka p\u00e5 delningsikonen till h\u00f6ger om dess namn.",
    "You have not deleted any libraries in the last {placeholder} days. A deleted library will be cleaned automatically after this period.": "Du har inte tagit bort n\u00e5gra kataloger de senaste {placeholder} dagar. En borttagen katalog kommer att rensas automatiskt efter denna period.",
    "You have not invited any guests yet. A guest can access shared libraries through the web interface allowing more efficient ways to collaborate than through links. You can invite a guest by clicking the \"Invite Guest\" button in the menu bar.": "Du har inte bjudit in n\u00e5gra g\u00e4ster \u00e4nnu. En g\u00e4st kan \u00f6ppna delade kataloger genom webbgr\u00e4nssnittet, vilket till\u00e5ter mer effektiva v\u00e4gar att samarbeta \u00e4n genom l\u00e4nkar. Du kan bjuda in en g\u00e4st genom att klicka p\u00e5 \"Bjud in G\u00e4st\" knappen i menyn.",
    "You have not published any libraries yet. A published library can be accessed by anyone, not only users, via its URL. You can publish a library by clicking the \"Publish a Library\" button in the menu bar.": "Du har inte publicerat n\u00e5gra kataloger \u00e4nnu. En publicerad katalog kan anv\u00e4ndas av alla, inte bara anv\u00e4ndare, genom dess URL. Du kan publicera en katalog genom att klicka p\u00e5 \"Publicera Katalog\" knappen i menyn.",
